import { configureStore } from '@reduxjs/toolkit';
import authReducer from './slices/auth.slice';
import agentsReducer from './slices/agents.slice';
import workflowsReducer from './slices/workflows.slice';
import systemStatusReducer from './slices/system.slice';

export const store = configureStore({
  reducer: {
    auth: authReducer,
    agents: agentsReducer,
    workflows: workflowsReducer,
    systemStatus: systemStatusReducer,
  },
  middleware: (getDefaultMiddleware) => getDefaultMiddleware({
    serializableCheck: {
      // Ignore non-serializable values in state
      ignoredActions: ['payload.config', 'payload.request', 'error', 'meta.arg'],
    },
  }),
});

export type RootState = ReturnType<typeof store.getState>;
export type AppDispatch = typeof store.dispatch;
